        super(props);

    }
    ProductDetail;
    render() {
        return (
            <div className="details-header">
                <button className="back-to-shop">
                    <i className="fa fa-chevron-left"></i>
                    <p>Back To Shop</p>
                </button>
                <button className="cart-button">
                    <i className="fa fa-shopping-cart"></i>
                    <sup>2</sup>
                </button>
            </div>
        );
    }
}



export default ProductDetail;
